INSERT INTO `sys_frmlab` VALUES ('08223707-bc01-4f52-bda2-801fff3e5a5e', 'ND701', '说明:以上内容是ccflow自动产生的，您可以修改/删除它。@为了更方便您的设计您可以到http://ccflow.org官网下载表单模板.@因为当前技术问题与silverlight开发工具使用特别说明如下:@@1,改变控件位置:&nbsp;@&nbsp;&nbsp;所有的控件都支持&nbsp;wasd,&nbsp;做为方向键用来移动控件的位置，&nbsp;部分控件支持方向键.&nbsp;@2,&nbsp;增加textbox,&nbsp;从表,&nbsp;dropdownlistbox,&nbsp;的宽度&nbsp;shift+&nbsp;->&nbsp;方向键增加宽度&nbsp;shift&nbsp;+&nbsp;<-&nbsp;减小宽度.@3,&nbsp;保存&nbsp;windows键&nbsp;+&nbsp;s.&nbsp;&nbsp;删除&nbsp;delete.&nbsp;&nbsp;复制&nbsp;ctrl+c&nbsp;&nbsp;&nbsp;粘帖:&nbsp;ctrl+v.@4,&nbsp;支持全选，批量移动，&nbsp;批量放大缩小字体.,&nbsp;批量改变线的宽度.@5,&nbsp;改变线的长度：&nbsp;选择线，点绿色的圆点，拖拉它。.@6,&nbsp;放大或者缩小　label&nbsp;的字体&nbsp;,&nbsp;选择一个多个label&nbsp;,&nbsp;按&nbsp;A+&nbsp;或者　A－　按钮.@7,&nbsp;改变线或者标签的颜色，&nbsp;选择操作对象，点工具栏上的调色板.', '168.24', '163.7', '11', '#FF000000', 'Portable User Interface', 'Normal', 'normal', '0', '0', '');
