INSERT INTO `sys_mapext` VALUES ('InputCheck_Demo_02_DianHuaHaoMa', 'Demo_02', 'InputCheck', '0', 'DianHuaHaoMa', '', 'function isTel(s) {\r\n    //var patrn=/^[+]{0,1}(\\d){1,3}[ ]?([-]?(\\d){1,12})+$/; \r\n    var patrn = /^[+]{0,1}(\\d){1,3}[ ]?([-]?((\\d)|[ ]){1,12})+$/;\r\n    if (!patrn.exec(s.value)) \r\n    {\r\n       alert(~非法的电话号码格式.~);\r\n       return false;\r\n    }\r\n    return true\r\n} ', 'D:\\ccflow\\trunk\\CCFlow\\Data\\JSLib\\onblur\\04.校验普通电话、传真号码：可以“+”开头，除数字外，可含有“-” .js', 'isTel', 'onblur', '', '', '500', '400', '0', '', '0', '');
INSERT INTO `sys_mapext` VALUES ('InputCheck_Demo_02_ShouJiHao', 'Demo_02', 'InputCheck', '0', 'ShouJiHao', '', 'function isMobil(c) {\r\n    var patrn = /^[+]{0,1}(\\d){1,3}[ ]?([-]?((\\d)|[ ]){1,12})+$/;\r\n    if (c.value == ~~)\r\n        return;\r\n    if (!patrn.exec(c.value)) {\r\n        c.focus();\r\n        c.select();\r\n        alert(~非法的手机号码.~);\r\n        return false;\r\n    }\r\n    return true\r\n}', 'D:\\ccflow\\trunk\\CCFlow\\\\Data\\\\JSLib\\onblur\\01.校验手机号码.js', 'isMobil', 'onblur', '', '', '500', '400', '0', '', '0', '');
INSERT INTO `sys_mapext` VALUES ('InputCheck_Demo_02_YouBian', 'Demo_02', 'InputCheck', '0', 'YouBian', '', 'function isPostalCode(c) {\r\n    var val = c.value;\r\n    if (val == ~~)\r\n        return;\r\n    if (val.length != 6) {\r\n        c.select();\r\n        c.focus();\r\n        alert(~非法的邮政编码格式.~);\r\n        return false;\r\n    }\r\n    var patrn = /^[0-9]+$/;\r\n    if (!patrn.exec(val)) {\r\n        c.select();\r\n        c.focus();\r\n        alert(~非法的邮政编码格式.~);\r\n        return false;\r\n    }\r\n    return true\r\n}\r\n', 'D:\\ccflow\\trunk\\CCFlow\\WF\\Data\\\\JSLib\\onblur\\07.校验邮政编码.js', 'isPostalCode', 'onblur', '', '', '500', '400', '0', '', '0', '');
INSERT INTO `sys_mapext` VALUES ('InputCheck_Demo_02_YouJian', 'Demo_02', 'InputCheck', '0', 'YouJian', '', 'function checkMail(c) {\r\n    var email = c.value;\r\n    if (email == ~~)\r\n        return;\r\n\r\n    //存在@符号\r\n    var a = email.indexOf(\"@\");\r\n    //是否存在点\r\n    var point = email.indexOf(\".\");\r\n    //存在@，点，并且 点在@之后，且不相邻\r\n    if (a == -1 || point == -1 || point - a <= 1) {\r\n        alert(\"Email格式不正确。正确的例如abc@ccflow.org\");\r\n        c.select();\r\n        c.focus();\r\n        return false;\r\n    }\r\n    //@不能够是第一个字符，点不能够是最后一个字符\r\n    if (a == 0 || point == email.length - 1) {\r\n        alert(\"Email格式不正确。正确的例如abc@ccflow.org\");\r\n        c.select();\r\n        c.focus();\r\n        return false;\r\n    }\r\n    return true;\r\n}', 'D:\\ccflow\\trunk\\CCFlow\\\\Data\\\\JSLib\\onblur\\08.校验email.js', 'checkMail', 'onblur', '', '', '500', '400', '0', '', '0', '');
