INSERT INTO `wf_labnote` VALUES ('001_662_127_3', '开发要点说明：\n----------------------------------------\n1，在开始节点表单中执行了表单保存后事件，可以把从表的小计求和放到主表单的只读字段HeJi中，实现了人民币大写的转换。\n 这个功能是通过表单的事件完成的，可以在节点表单、表单事件产看到。\n2，根据报销金额，设置了方向条件，可以在连接线上点击右键，方向条件看到设置的方向转向。\n3，此流程采用了瀑布的方式设计，所以有两个【财务报销】节点，但是您可以看到，流程运动的路径不同，所以表单也不同。\n4，在各个节点上，用到了图片签名。这里特别说明：图片签名不等于电子签名。\n5, 设计此流程的表单全部采用了自由表单，如果想看傻瓜表单效果，请节点属性的表单类型进行设置。', '001', '662', '127');
