INSERT INTO `wf_labnote` VALUES ('002_676_63_7', '不同的人员走不同的路线可以避免一个人处理两个相同的节点，比如部门经理发起，部门经理审批的情况。\n由发起人的岗位来决定流程的路线可以在线上右键查看到岗位条件。', '002', '676', '63');
