INSERT INTO `wf_labnote` VALUES ('005_306_213_1', '发起节点可以有n个人接受，每个人处理完后就发送到汇总节点。', '005', '306', '213');
INSERT INTO `wf_labnote` VALUES ('008_396_107_1', '在中间的子线程节点上配置一个SQL语句，此SQL必须具有No,Name两列，它是用来标识接受人编号\r接收人名称，其他的列与子线程的主表数据源字段对应，就可以实现自动数据copy.', '008', '396', '107');
