INSERT INTO `wf_labnote` VALUES ('038_295_109_1', '流程案例说明\n1，是同表单的分合流流程。\n2，子线程的各个成员填写完明细表后，就i汇总到下一个合流节点上去。\n设计步骤：\n1，分别在子线程与合流节点各设计一个明细表，让其明细表的字段与表名相同。\n2，在子线程的明细表的权限是WorkID,在合流节点的明细表名是FID。', '038', '295', '109');
INSERT INTO `wf_labnote` VALUES ('044_355_169_1', '具有两段分合流的同表单分合流。', '044', '355', '169');
