INSERT INTO `wf_labnote` VALUES ('055_245_409_2', '绑定了周朋处理', '055', '245', '409');
INSERT INTO `wf_labnote` VALUES ('055_318_229_3', '在节点的基本属性里设置是外部用户节点', '055', '318', '229');
INSERT INTO `wf_labnote` VALUES ('055_484_37_4', '\r注意在单元测试过程中用到了这个demo，请不要修改消息机制的规则，否则单元测试就运行不成功。\r\r1, 在开始节点设置了,向下一步接受人发送邮件，向指定字段作为手机号发送短信.\r\r2, 对应的单元测试： BP.UnitTesting.SendMessage\r ', '055', '484', '37');
INSERT INTO `wf_labnote` VALUES ('055_61_207_5', '绑定了郭祥斌处理', '055', '61', '207');
INSERT INTO `wf_labnote` VALUES ('068_322_128_1', '只有在web.config中配置了 IsEnableTaskPool=1 才能看到共享任务\nccflow 驰骋工作流引擎的共享任务，应用背景，设置，设计，sdk接口\nhttp://bbs.ccflow.org/showtopic-2066.aspx', '068', '322', '128');
INSERT INTO `wf_labnote` VALUES ('069_333_97_1', '以分流点的明细表作为子线程的接受人与数据源的案例。\n1，在分流点设置一个明细表，用来采集子线程的接受人员与子线程的主表数据。\n2，子线程主表的数据要与明细表的列字段对应，可以实现数据的自动copy.\n3,  分流点的明细表必须具备UserNo列，这两个列就是接受人员编号与名称。', '069', '333', '97');
INSERT INTO `wf_labnote` VALUES ('071_374_117_1', '第一个节点批量发起，请参考流程属性设置。\n第二个节点批量审核，请参考节点属性设置。', '071', '374', '117');
INSERT INTO `wf_labnote` VALUES ('079_276_16_1', '第一个节点批量发起，请参考流程属性设置。\n第二个节点分组审核，请参考节点属性设置，分组审核后发起的另外一个流程，另外一个流程就是此流程的父流程。\n\n应用场景:\n1,国土资源厅在审核多个项目，这多个项目具有一致性.\n2,多个项目需要发起一个公文流程，多个项目的子流程还要运转下去。\n3,新启动的流程是这多个项目的父流程。这种模式就是现有子流程再有父流程案例。\n', '079', '276', '16');
INSERT INTO `wf_labnote` VALUES ('120_315_189_1', '自由流程，就是开始节点或者，中间的指定节点，可以自己定义流程运行的步骤，定义流程运行的人员。', '120', '315', '189');
INSERT INTO `wf_labnote` VALUES ('121_404_63_1', '1, 该流程为自由流程的子流程.\r2, 用来演示子流程吊起它.\r3, 该流程流程属性里设置了它是子流程, 并且不能单独发起.\r4, ', '121', '404', '63');
INSERT INTO `wf_labnote` VALUES ('122_391_64_1', '相关说明ccflow如何实现批次维度任务流程\rhttp://bbs.ccflow.org/showtopic-3070.aspx', '122', '391', '64');
INSERT INTO `wf_labnote` VALUES ('130_193_17_1', '测试1： 当前节点的所有未完成的子流程.\n--------------------------------------------\n在节点B上可以启动子流程，并设置了当前点所有的子流程的发送阻塞,使其子流程没有走完就不让其发送到节点C, 如果成功则设置有效.\n\n测试2： 按约定格式阻塞未完成子流程\n--------------------------------------------\n在节点C上可以发起了两个子流程催款与施工,但没有设置发送阻塞,让其在子流程没有完成的情况下向下运动到节点D.\n在节点D设置阻塞规则为{按约定格式阻塞未完成子流程}，看看是否正确的提示了信息。', '130', '193', '17');
INSERT INTO `wf_labnote` VALUES ('139_63_239_1', '如果客户需要发票就启用这个分支', '139', '63', '239');
INSERT INTO `wf_labnote` VALUES ('167_138_281_1', '中间节点是一个多人处理的工作节点，使用了协作规则，因为这里审核没有设置他们的先后顺序。\n\n如果有先后顺序的就是队列模式，协作模式与队列模式，都是由最后一个工作人员发送到下一个节点上去。\n\n关于多人处理节点的模式，请参考操作手册。\n', '167', '138', '281');
INSERT INTO `wf_labnote` VALUES ('167_250_287_2', '', '167', '250', '287');
INSERT INTO `wf_labnote` VALUES ('196_576_110_1', '子流程结束后有三种情况.\n------------------------------------\n1.不处理(让父流程出现待办).\n2.自动运行到下一步骤.\n  如果自动运行到下一步骤，设置可以找到人可以找到到达的节点. 就可以, 否则不要选择这个规则.\n3.结束父流程.  ', '196', '576', '110');
INSERT INTO `wf_labnote` VALUES ('197_326_120_1', '开始节点是否把父流程的数据带回来', '197', '326', '120');
INSERT INTO `wf_labnote` VALUES ('197_392_316_2', '流程结束时是否父流程自动也结束了？', '197', '392', '316');
INSERT INTO `wf_labnote` VALUES ('205_174_364_1', '金额小于等于1万', '205', '174', '364');
INSERT INTO `wf_labnote` VALUES ('205_323_246_2', '金额大于1万', '205', '323', '246');
INSERT INTO `wf_labnote` VALUES ('205_662_127_3', '开发要点说明：\n----------------------------------------\n1，在开始节点表单中执行了表单保存后事件，可以把从表的小计求和放到主表单的只读字段HeJi中，实现了人民币大写的转换。\n 这个功能是通过表单的事件完成的，可以在节点表单、表单事件产看到。\n2，根据报销金额，设置了方向条件，可以在连接线上点击右键，方向条件看到设置的方向转向。\n3，此流程采用了瀑布的方式设计，所以有两个【财务报销】节点，但是您可以看到，流程运动的路径不同，所以表单也不同。\n4，在各个节点上，用到了图片签名。这里特别说明：图片签名不等于电子签名。\n5, 设计此流程的表单全部采用了自由表单，如果想看傻瓜表单效果，请节点属性的表单类型进行设置。', '205', '662', '127');
